import React from "react";

function Info({ invoiceNo, recipient, itemName }) {
  return (
    <div className="info">
      <div>운송장번호: {invoiceNo}</div>
      <div>받는사람: {recipient}</div>
      <div>주문상품: {itemName}</div>
    </div>
  );
}
export default Info;
